import React from "react";
import "./index.css";
import Home from "./routes/Home";
import Club from "./routes/Club";



function App() {
  return (

    <Router>

    <div className="App">
       <Route path='/' element = {<Home />} />
       <Route path='/Club' element = {<Club />} />

    </div>
    </Router>
  );
}

export default App;
